 for a hunch on himself on one occasion, when he shocked Old Students with a stunning spell of new ball bowling to snare 4/19 off eight overs. But it is with the bat that he makes the biggest impact, having played some scintillating innings over time, with consistency his only downfall.\n\nSidebottom\'s greatest innings is undoubtedly his 89 against Invergordon, when he tore the opposition to shreds. Had he not been given leg before by his father Greg (and it was out), he would surely have set a high score mark that would take some beating; when he was dismissed, little more than half the 40 overs had been bowled.\n\nFollowing that first season, Sidebottom made three appearances in Melbourne and although he didn\'t taste victory, his fast starts provided a platform that so easily could have brought about a win. He finally made a proper return to the team during Willowfest 2010, where he excelled in the field and, aside from the Grand Final, appeared to be more dependable with the bat than ever before. He bettered his output in 2011, hitting 129 runs in four innings at a strike rate of 80. This included a magnificent 71 in the final match against SPL St Columbs All Stars, which was followed by a terrific diving stop and runout to all but ensure the premiership win.'),(11,'',NULL,NULL,NULL,'Right-hand bat','Legbreak googly',NULL,'Shepparton United',NULL,7,NULL,'A Shepparton United legspinner, Michael Tate was drafted into the inaugural team to make up the numbers. Handed the ball late in Pine Lodge\'s innings, he hastened the finish with 2/8 off 11 balls.'),(12,'','1986-09-16',NULL,NULL,'Right-hand bat','Right-arm medium fast',NULL,NULL,NULL,8,NULL,'A Shepparton United batsman, Steven Tate was drafted into the inaugural team to make up the numbers. At his best a big hitting and big scoring opener, he got the chase off to an excellent start with a quick 20, before returning to higher grades.'),(13,'Christopher Peter Taylor','1988-09-14','Shepparton','Tay','Left-hand ba