's dads don the baggy red during the first season, John Watt decided to have a crack himself and join his two boys in the side. Some may say that he pioneered the JWXI staple position of specialist tailender, however he was far more adept with the bat than most in that position and should not be compared with the ultimate specialist tailender in Kenya\'s Lameck Onyango for that reason (he is also not black). After a sterling 7 on debut, Watt suffered the ultimate ignominy by falling lbw to Pine Lodge keeper Steven Pigatto.'),(24,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Shepparton United',NULL,22,NULL,'One of a number of umpiring recruits, Darren Meek proved to be a highly effective batsman at both ends of the order in his two matches. Batting at three on debut, he put on 63 off 43 balls with Ashley Keating, before accompanying Chris Taylor in the early stages of his historic first hundred. In an interesting move, Meek was demoted to 10 for his next match, where he smacked 23 in a lost cause.'),(25,'','1992-04-01',NULL,NULL,'Right-hand bat','Right-arm medium fast',NULL,'Shepparton United',NULL,23,NULL,'Quite the opposite to father Darren, Jeremy Meek was a tearaway fast bowler and a bit of a mug with the bat. After an impressive showing with the new ball on debut, he was dealt with harshly by a strong Kialla outfit, who terminated his fledgling career by taking 42 runs off five overs and removing him for a duck in his only innings.'),(26,'',NULL,NULL,NULL,'Right-hand bat','Right-arm slow medium',NULL,'Shepparton United',NULL,24,NULL,'Dale Turvey finally scored a call up late in the first season, however he may have wished he hadn\'t bothered. Handed a late over against a rampant Old Students, he was taken for a club record 25 runs. Things improved slightly with the bat, but by the following week Turvey was on the sidelines downing a few frothies.'),(27,'Rory Eli Herd','1989-12-16',NULL,NULL,'Left-hand bat','Left-arm medium fast',NULL,'Glenroy',NULL