d, Barclay was in the process of forging a high level career at arch rivals Old Students, although he did find time to snare a catch as a substitute during a big win over Pine Lodge. As a result, it took until the final round of the 2008/09 season for him to debut; a wise choice as it was the famous Cas Quest match. Out of 276, he returned magnificant figures of 8-4-1-29 and having one catch dropped, although he spilt one of his own, before getting the improbable chase off to a flyer with 20 off 16.\n\nIt was through Willowfest that Barclay found his Johnnie calling, being handed the captaincy for the maiden trip in 2009 thanks to his Mildura knowledge and general superiority of a group containing its fair share of spuds. Even so, he surprisingly decided to bowl himself rarely. In a carnival that was tough for most batsmen, two good starts were enough for second most team runs, including a quickfire 39 on the last day to hasten a big victory, pleasing much of the tired squad.\n\nAn even more frugal cameo (1/4 off five overs) in early 2010 reminded the Johnnie faithful of his bowling talents, and by the 2010 carnival he hade made himself part of an imposing five-pronged pace attack, picking up five wickets. His batting surprisingly stuttered, managing just 34 runs in four innings, though it was still enough for fifth-most runs. The pattern continued through the first three games of the 2011 carnival until it was spectacularly broken with a masterful unbeaten 49 to drive the team to an important victory over Ray White\'s Dirty Dozen. That new high with the bat followed a personal best bowling effort of 4/21 the previous day; part of a haul of eight wickets. These performances were as critical as any to the maiden premiership win. Barclay will be back in 2012 to add \"back-to-back\" to his already enviable title.'),(66,'','1987-06-22',NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,65,NULL,NULL),(67,'Kale Leith Cetinich',NULL,NULL,'Cetters, K-Cet, Gog