slumber. The pair added 88 in less than 10 overs; a record partnership for the 5th wicket that lasted almost two years. The innings proved to be a false dawn, as he closed out the season with 36 runs in a further four innings.\n\nWhile the 2010/11 season lacked a notable score, Cetinich discovered the consistency that had hitherto eluded him, notching six consecutive double figure scores. With 122 runs, the Batting Award would have been his in a curtailed year, were it not for Ben Carr\'s century in the final game. The 2011/12 season was another up and down year, bookended by another two 40+ scores. The second - a robust 43 - almost single handedly put the Johnnies into a Grand Final after a chase of 138 had grinded to a crawl. This included a monster blow off a pace bowler that had most of the team fearing for their lives, and had removed Cetinich for a golden duck during their previous meeting. Although the win was missed, the innings gave him a new season best 144 runs.\n\nNestled within this season was a maiden Willowfest appearance, which he celebrated by helping the lads to a premiership. While his batting suffered (1 run in two innings), he performed a surprising star turn with the ball in an important match against Ray White\'s Dirty Dozen. Exploiting a lively pitch, he managed to seam his slow mediums both ways to pick up 2/32 off 10 overs.\n\nCetinich possesses a sound pair of hands and is often stationed at point, where he has snared most of his 16 catches at a sensational rate of one every two matches.'),(68,'','1988-04-24',NULL,'Coxy','Right-hand bat',NULL,NULL,'Glenroy',NULL,67,NULL,NULL),(69,'','1992-06-17',NULL,'Dolfino','Right-hand bat','Right-arm medium fast',NULL,'Glenroy',NULL,68,NULL,NULL),(70,'Benjamin John Carr','1988-10-17',NULL,'Carree, Tough C**t','Left-hand bat','Right-arm medium',NULL,'Glenroy',NULL,69,NULL,NULL),(71,'',NULL,NULL,NULL,'Right-hand bat','Legbreak googly',NULL,'Glenroy',NULL,70,NULL,NULL),(72,'',NULL,NULL,NULL,'Right-hand ba