{55)R5[\\HHXmxy8*L.<}JppC|\Z8','Pete Barclay joined his two sons for the first Willowfest campaign and, despite his advancing years, was one of the few solid performers, being one of five players to average double figures while tidily keeping wicket. Though there were no big scores, he endured some testing spells of bowling and ensured that the typical Johnnie collapse was quelled during his stay. His highlight of the week was undoubtedly the final match, when he helped Travis Murdoch to a five wicket haul with a club record three stumpings.\n\nBarclay\'s appearances have been more fleeting since, focusing more on the important role of tour manager to keep the boys in check, yet despite announcing his retirement on several occasions, he played four of the five games in the 2012 premiership defence. He knocked up an aggressive 17 against eventual premiers Muppetts to suggest he\'s not quite done with just yet.'),(78,'','1992-07-25',NULL,NULL,'Right-hand bat',NULL,NULL,'Willowfest',NULL,78,NULL,NULL),(79,'Sean Nathan Allott Dixon','1987-01-14',NULL,NULL,'Right-hand bat',NULL,NULL,'Glenroy',NULL,79,NULL,NULL),(80,'','1987-08-20',NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,80,NULL,NULL),(81,'',NULL,NULL,'Harry','Right-hand bat','Right-arm medium fast',NULL,'Glenroy',NULL,81,NULL,NULL),(82,'',NULL,NULL,'Sagi','Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,82,NULL,NULL),(83,'Adam Gregory Strelec','1986-05-16',NULL,'Strel','Left-hand bat','Left-arm medium',NULL,'Glenroy',NULL,83,NULL,NULL),(84,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,84,NULL,NULL),(85,'Tharindu Deemantha Jayakodi Arachghige','1994-08-04','Colombo, Sri Lanka?','Tee, Bushells','Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,85,NULL,NULL),(86,'',NULL,NULL,NULL,'?','Left-arm medium fast',NULL,'Glenroy',NULL,86,NULL,NULL),(87,'',NULL,NULL,'Yumi','Left-hand bat','Legbreak google',NULL,'Glenroy',NULL,87,NULL,NULL),(88,'',NULL,NULL,NULL,'Rig