t the pill all over the picturesque Mildura Senior College No. 2 ground, bringing up a maiden half-century off just 37 deliveries. As well as setting up a confidence boosting win going into the Grand Final, 73 off 55 balls represented the fifth highest score at the time and cemented his reputation as a clean hitter.\n\nDowell was only called upon to bat three times in 2011, bookending the carnival with important knocks of 24 and 29. A drop in keeping form signalled a brief return to the bowling crease, where he sent down a promising over of swing bowling. As the Johnnies look kindly on isolated performances, he may find himself rolling the arm over more frequently in 2012.'),(93,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium fast',NULL,'Glenroy',NULL,93,NULL,NULL),(94,'','1987-03-24',NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,94,NULL,NULL),(95,'',NULL,NULL,NULL,'Right-hand bat','Legbreak googly',NULL,'Glenroy',NULL,95,NULL,NULL),(96,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,96,NULL,NULL),(97,'','1993-11-17',NULL,NULL,'Right-hand bat',NULL,NULL,'Glenroy',NULL,97,NULL,'Aside from an impossibly large surname, Janish Suriyaaratchchi\'s major JWXI contribution came on debut against Ascot Vale in early 2011, helping captain Geoffrey Williams recover from an embarassing 4/16 to a more respectable 85. Suriyaaratchchi belied his years as he concentrated on stout defence, absorbing over 40% of the total innings en route to a 70 ball 15.'),(98,'','1984-06-07',NULL,NULL,'?','Left-arm medium',NULL,'Glenroy',NULL,98,NULL,NULL),(99,'','1992-12-29',NULL,NULL,'?','?',NULL,'Glenroy',NULL,99,NULL,NULL),(100,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,100,NULL,NULL),(101,'','1993-02-06',NULL,NULL,'Right-hand bat','Right-arm fast medium',NULL,'Glenroy',NULL,101,NULL,NULL),(102,'Billy Jay Morrison','1995-04-15',NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,102,'\0JFIF\0\0`\0