club via fellow Glenroy resident Matthew Cross, Morrison struggled to score a run in his first three innings, cobbling together just six. In fairness, it was his first crack at the game, which made his knock against Sydenham Hillside all the more remarkable. In 67 balls of carnage, Morrison carted a hapless attack all around the small Copperfield College ground, striking nine huge sixes and moving from 50 to 100 in an incredible 22 deliveries before being forced by league rules to retire. Unfortunately, Morrison quickly returned to his pre-century form, making just three runs in two innings before disappering in the wake of JWXI\'s Melbourne recess.'),(103,'Kevin P Spaull',NULL,NULL,NULL,'Right-hand bat','?',NULL,'Glenroy',NULL,103,NULL,NULL),(104,'',NULL,NULL,NULL,'Right-hand bat','Right-arm offbreak',NULL,'Glenroy',NULL,104,NULL,NULL),(105,'Stephen Ritchie',NULL,NULL,NULL,'?','Right-arm medium',NULL,'Glenroy',NULL,105,NULL,NULL),(106,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,106,NULL,NULL),(107,'',NULL,NULL,NULL,'Right-hand bat','Legbreak',NULL,'Glenroy',NULL,107,NULL,NULL),(108,'',NULL,NULL,NULL,'Right-hand bat','?',NULL,'Glenroy',NULL,108,NULL,NULL),(109,'',NULL,NULL,NULL,'Right-hand bat','Right-arm medium',NULL,'Glenroy',NULL,109,NULL,'Steve Potger is one of the many Glenroy players to have filled in for JWXI. Despite a complete lack of batting technique, Potger possesses a good eye and a powerful swing, which was good enough to win him a C Grade batting award in 2010/11. His skill set was on show during his only, brief innings, picking up a boundary in a five ball stay.'),(110,'',NULL,NULL,NULL,'Right-hand bat','Right-arm offbreak',NULL,'Glenroy',NULL,110,NULL,'Chris Randall is one of the many Glenroy players to have filled in for JWXI. Despite not getting a hit in the impressive 2011/12 chase against Sunshine YCW, Randall is a skillful young batsman who has been selected by Carlton to come through the premier cricket ranks.');
