INSERT INTO `review` VALUES (1,'The season started on a positive note for the uni boys as they notched their maiden win in the Glenroy colours by chasing down 151, despite Millsy giving 3 lbws in 5 balls. The following week was even better as the boys reached the 229 run target with only 5 wickets down. The win was especially significant as Ben Perry  a man whose entire cricket career consisted of a golden duck, stuck around with Millsy for a 110 run partnership, stroking a quickfire 44 in the process. Unfortunately, no one had picked up the fact that Ben had played for Sunshine the year before, so the points were stripped, and from there the season quickly went downhill. We had to contend with 2 A-Grade players against The Socials in Round 3  subsequently the match lasted little more than 30 overs.\n\nA terrific performance in the field against Royal Park in Round 4 left us chasing just 133 for victory. Sitting pretty at 1 for 69, a string of terrible shots and dodgy umpiring decisions left us reeling at 7 for 79. Still, we almost reached the goal, but 2 wickets in 2 balls carved us off at 128. And so began a streak of 8 consecutive losses.\n\nPerhaps the game that typified the performance of the time was in Round 9 versus Sunshine. The boys had done well to keep the ladder leaders to 5/168, before Chris Taylor went on a rampage, having 2 batsmen caught at cover by Clinton Murdoch. The hat-trick ball went along to the familiar script, however Clinton proceeded to drop the lollypop. Things were made worse when Chris picked up another wicket next ball. It would have been the only instance we know of where a tennis player has made a century and taken a hat-trick. The tragedy of the near-miss was compounded by the capitulation that was 77 all out, despite Vaughan Garners knock of 37, who departed when the score read 7 for 66. Dave Lyons was the next highest scorer with 9.\n\nThe long wait for another win finally ended when the boys racked up 6 for 269, with each batsman getting into double figures. Employing an umbrella field worked wonders as 2 run-outs were picked up  1 as the batsman took a suicidal single to silly mid on, and another when Chook Williams dropped a sitter, allowing Dave the chance to hurl one into Coxy who did the rest (amazingly, a similar run-out had been achieved the previous week). The match meandered dreamily from then on, as the lads basked in the 94 run win.\n\nMillsy enjoyed a watershed year, scoring 386 runs, pouching 7 catches with the gloves (and 2 without) and showing he was no slouch with the ball either, snaring 5 wickets to slot into equal third for the team and ultimately the overall award. By achieving this, however, he allowed Vaughan enough time with the gloves to pick up 7 catches  3 of which came in the last game - and 2 stumpings to sneak the keepers prize. Chris had some deadly spells with the ball to take the bowling award with 13 wickets. Last place did not do justice to the boys talents  it was simply a case of almost, but not quiet.'),(2,'2009/10 proved to be a far more fruitful year for the uni boys as a regular group of players were able to gel together with consistent success. After last years wooden spoon, everyone was ready to make amends and give it a red hot go, culminating in a well deserved finals spot.\n\nCRACKING START \n\nAn early batting collapse against St Albans in Round 1 left us tottering at 4/22, but with Jack Coxy Hancock holding up an end, taking 34 balls to make 6, we were able to dig our way out. Chris hit one of his slowest innings of all time (59 off 55...), combining well with Coxy and Clinton, before Andy and Steve put on a crucial 24 for the last wicket. The bowlers were well up to the task of defending 124, not allowing the opposition to get away. A 25 run stand for the last wicket resulted in shredded nails, but Clintons return and Vaughans introduction brought a halt to the scoring. Clinton picked up the last wicket to finish with 2/10 off 7.5, while Steve, Chris and Coop also picked up 2 to round out a 17 run win. Next up were bitter rivals Pascoe Vale. Once again the top order failed to fire, though much of this was the teams own doing  Vaughan and Millsys anyway. First Millsy ducked underneath a full toss only to be bowled, but despite the no ball being called by square leg, previous experience with the matter led Vaughan to rule Millsy out from the sheds. Subsequent research and enquiries to the MCC have since proved fruitless. This was followed by Millsy giving Vaughan out caught behind off the pad, leaving us at 4/33. Solid outputs from Dolf, Andrew Hewitt and Johnny Derwent got the innings to a defendable score, however it was Coop and Carree who really stole the show, hitting the bowlers to all parts for a competition high 55 runs for the 10th wicket. Pascoe Vales reply got off to a terrible start when the non striker could not beat Carrees bullet arm to Millsy on the first ball. With only 8 players, someone needed a score, but another economical performance from Clinton and Coops only catch of his Glenroy career to date, via a Millsy deflection, led us to an emphatic win. Our record would soon be 3-0 after a dominant 152 run victory over Royal Park. Millsy finally went onto the big one, making 102. His century, coming off 98 balls, was not without incident as he was dropped after smashing a hook shot to short square leg, somehow convincing Dolf that there was a run on. Result  Dolf run out , Millsy still perched inside his crease. Millsy and Vaughan put on 77 for the 6th wicket to guide the score to 7/206. Vaughan would likely have remained not out but, seeing a slow bowler and an open leg side, went for piccione points. Instead, he copped a blow to his unprotected nether region, and, deciding not to retire hurt, skied the next ball straight back to the bowler. A team effort in the field left Royal Park reeling at 7/30 at drinks, before some extreme experimentation (Marshall bowling?) allowed them to reach 54. Personal thanks from Vaughan for the batsman that walked after no appeal from the bowler with the reasoning that I think I hit it, and Coop for the only club umpire to give us an LBW all year which, although being plumb, was probably only given because the umpire wanted to go home.\n\nHISTORY REPEATING? \n\n2 losses in a row brought back bad memories of last season when, having won the first 2 games, everything fell apart. Playing Barkly St. on an absolute minefield of a ground, stopping runs was never going to be easy, especially when higher grade players are dropped back to beat us. On this occasion the bloke made 101*, although this was achieved thanks to incompetent scorers with the book showing 96 (this report could not possibly fit the rest of the errors). The first wicket was something of an anti-climax. The ball carried to Marshall at fly slip as the rest of the team watched in complete silence, before erupting when the catch was taken. The fact that we came close to chasing 215 was thanks to three big contrasting innings. Millsy hit everything that came at him in his 48 off 42, Vaughan started slowly before accelerating to 46, and Marshall held up an end in his 59 off 91. Unfortunately, he also ran out Chris for a golden duck, just as we needed to up the scoring rate, and we were all out for 195 in the last over. Two weeks later we faced ladder leaders Moonee Valley. A quick 64 from Marshall and a slogged 33* from Vaughan got us to 6/163. Although the bowlers kept it tight, dropped catches and a lack of wickets meant a last over loss. A minute later, the rains came.\n\nSOLID MID-SEASON \n\nThe rebound started in a bizarre match against Haig. After restricting Haig to 8/144, we made a solid start reaching 2/63, before an inexperienced middle order put on a collapse of 5/6. Vaughan, on 21, watching the carnage at the other end, thought the game was up, then a different type of carnage ensued, thanks to Chris blitz. The next 2 overs before drinks gathered 23 runs, and 4 overs after drinks the match was over after a further 53 runs were smacked. Chris 51* off 19 balls, including 9 fours and 2 sixes, probably will not be beaten for some time, while Vaughans 37* and ability to stay at the crease for Chris proved almost as important. Next was a comfortable victory over Sunshine. Clinton, Vaughan and Chris suffocated the batsmen; all three of them went for less than 2 runs an over from a combined 20 overs. The chase was comfortable, despite steady wickets, thanks to Millsys stonewalling and Dolfs bravado, and was completed in the 26th over. To make sure there were no doubts about the result, first Clinton got 4 overthrows to finish on 6* off 2, then Dolf hit a straight 6 to finish 12 runs ahead.\n\nRUN TO THE FINALS \n\nFirst up after the Christmas break was a carbon copy loss to Moonee Valley. Chook and Kale being bowled by the slowest, highest balls you are likely to see in the same over didnt help the cause. Another loss thanks to St. Francis smashing us around the park (7 dropped catches and more high grade players contributed to the downfall), followed by a loss of points in our win over Barkly St., meant we were on the verge of missing the finals again. Mind you, we probably got lucky here  Vaughan was dropped twice on his way to the worst 66 of all time; only batting properly after some friendly abuse from umpires Clinton and Millsy, Kale defied his season average of 9 to belt 47 off 35 balls, we took a turn at pinching A grade players from Shepp and Chook bowled a fair bit of filth to go with maybe 1 good ball, and still took 3/9 off 4 overs. And...\n\nChris ridiculous low catch on the fine leg boundary to give Chook his first\nVaughan defying gravity to almost pull in a stunner at cover, however it would have given Chook a 4th wicket\nChris getting an easy runout to finish the match - while conversing with the square leg umpire\nAn easy win over Haig (Marshall took 2/20 to star with the ball and Chris took his Haig tally to 92 off 45 for once out) was countered by a poor loss to the Socials, meaning that we had to beat Royal Park to ensure finals action  and another shot at the Socials. Some complacency late in the innings allowed them to make 7/166, and although we were struggling a little at 3/57, Clintons 59 and Millsys 45 gave us a comfortable win.\nQUALIFYING FINAL \n\nA tight opening spell from Clinton suffocated the Socials early and the benefits were felt at the other end with Dolf coaxing the hack opener into a soft shot to Kale at cover. The other opener was hitting the ball at will though, and they were able to reach drinks at 1/89. Vaughan bowled the #3 first ball on resumption, but that only brought the 2 best batsmen in the team together. A number of dropped catches hurt us greatly, but with the most surreal thunderstorm any of us ever likely to see settling in, (we only left the field after it put half the ground in near darkness  harden up ICC), we were given a nights respite with the score reading 2/111 in the 22nd over. We should have stayed in bed. Steve, Chook, Marshall and Coop were unavailable for day 2 and we could only get 8 on the field. Coops absence was particularly damaging after going at just 3 runs per over the previous evening. After much toiling, Clinton finally got a reward, removing the other opener for 82  about 70 more than he should have got. Vaughan then delivered the most delicious of his it AKA slower balls to get an LBW, but the damage had already been done, and we were left to chase a tricky 227 on a slow outfield. Millsy and Vaughan made a mockery of the chase early with a magnificent, chanceless partnership of 101 by drinks. There mustnt have been enough sugar in the cordial though. Millsy poked around at some innocuous leg spin, then tried to launch one over square leg, only to fail by a couple of metres, departing for a lovely 52. Vaughan then got tied up at one end, succumbing for 51 as he tried to break the shackles as the asking rate got higher. Chris and Clinton kept us in it for a while but in the end it was just out of reach. At the end of the day though, 199 was a terrific effort and our second highest team total for the year. Coming from 4th place, a semi final berth was available if 1st and 2nd both won, but Moonee Valley  missing their captain  lost to 6th, and so we were knocked out. At least Moonee Valley went out the following week. All up though, it was a big improvement on last year. We won 5 more games, ran the minor premiers close twice, smashed the eventual premiers in Pascoe Vale and were consistently competitive thanks to some marked improvement from the entire core playing group, including;\n\nMillsys second 350+ run season in a row, and Vaughans first 300+ run season\nChris and Dolf both making over 200 runs (4 this year to 3 last year)\nMarshall again almost making 200 despite missing 3 games\nClinton and Coop both taking more than 15 wickets (none last year) and Chook and Dolf taking 10\nMillsys 369 runs, 3 wickets and 21 catches (19 as keeper) earned him back to back Club Champion trophies, Vaughan took the batting average with 348 runs at 34.8 and Coop was able to sneak the bowling average with 16 wickets at 16.81, despite Clintons 17 wickets.'),(3,'It was very much a season of two halves for the boys this year. With Chris at the helm again, the uni boys dominated before Christmas, but the side gradually fell away as numerous players became unavailable. Signs were good early with a strong team effort dismantling Moonee Valley by eight wickets in round three. It turned out to be the only match in the first six weeks due to rain and forfeits. When we finally got back on, the going was much tougher, despite the one-off appearances of Millsy and Vaughan courtesy of match abandonments in their grades. After the Socials got away quickly, Vaughan (3/6) and Carree (2/13) demolished the rest of the lineup, with the remaining seven wickets falling for just 16 to be all out for 83. Despite a few hiccups, the target was reached comfortably enough with three wickets in hand. This was followed by a brutal display against Barkly St. Chris started the rot by under-arming the ball at the stumps from a Ricky delivery to earn a bizarre stumping, shortly after taking his first ever catch with the gloves, to leave Barkly St. struggling at 2/1. Some excellent bowling from Carree (3/10), Steve (2/21) and Yomi (3/27) cleaned them up for 91. The reply was swift as Marshall and Kale belted the bowlers to all parts, knocking off the target two down in just 17.4 overs. The boys came back to earth with a thud before Christmas against St. Francis  only Ben and Kale passed 10, as we were comprehensively beaten by nine wickets.\n\nChris post-Christmas departure left the boys without a captain. Millsy filled the breach for the first match after he was unable to play B Grade. Despite Cams 4/24, Haig were able to reach 159 without too much trouble. The reply looked dead in the water at 5/63, but a fantastic counterattack from Strel  who everyone thought couldnt bat  gave us a slim hope. He finished with an unbeaten 33, out of 46 runs scored while he was at the crease, but we still fell 50 runs short. Chook took over the reins the following week against West Coburg. We fared even worse with the ball, but on a small ground 179 seemed reachable. Millsy came good with a well paced 54, and with Carree and Strel making good contributions we fell an agonising nine runs short, bowled out with four balls remaining.\n\nDespite a third loss in a row against Ascot Vale, we were still well in contention for finals with four matches to play. A win over Barkly St. would have helped no end, and half way in we were well on our way after posting 5/204, thanks to Carrees magnificent 107 off 105 balls. Carree hit 16 fours and a six, and was well supported by Chook (41 off 72) as they put on 157 runs in 25 overs for the 4th wicket. Carrees contribution to the partnership was 90, while extras made up a staggering 32, and 40 of the overall total. With only nine players and a solitary sub fielder, the bowling had to be on song. It wasnt  56 extras, including 32 wides and 17 no balls smoothed the path to the target, which Barkly St. reached just three down with an over to spare. The main highlights were Chook taking his first ever catch behind the stumps after a difficult couple of matches and Marshall donning the gloves a couple of overs later to take one off Chook, moments after allowing a harmless delivery to elude him for four byes.\n\nBut just like that, it ended. A chronic player shortage the following week left Marshall to become the fourth captain of the season, but with just Kale by his side (there were six former JWXI players in total, but only two regulars), the match was not given JWXI status. Chook would return for the final two matches but no other players could be found, resulting in a sudden recess.\n\nCarrees century was more than enough to take out the batting award (152 runs @ 38) before he went up to C Grade, while Kale enjoyed a consistent season that netted him 122 JWXI runs and 185 all told. Carrees all-round form meant he took the Champion Player award as well. Steve, despite only taking two wickets after Christmas and leaving the country at the start of February, surprisingly held on to win the bowling award (8 wickets @ 17.38), one wicket ahead of Coop and Carree.'),(4,'Ive had a habit of writing reports that go on and on in the past so this year Ill try to be brief. To summarise, the boys had a wonderful season, ultimately falling just short, but for a team full of easy going lads it was a stunning effort to be able to compete with and beat more talented teams.\n\nA top three finish looked a distant prospect during a rain and forfeit-marred opening two months. Our first three matches on the field resulted in a comfortable win over eventual premiers West Coburg, a draw thanks to Chris Taylors generous offer to call off the half-complete game against cellar dwellers Moonee Valley at the first sight of rain and a disappointing loss against Barkly St with the match in the bag. The defeat signalled a streak of six consecutive wins, beginning with a crazy victory over Sunshine, which was achieved thanks to Aaron Patakis 4/24 and despite eight batsmen combining for just 15 runs. An incredible team demolition job led by Jacob Coxs 11-ball 36 (which included three balls in a row sailing into adjoining houses) exacted justice over Moonee Valley, while a similar effort accounted for West Coburg in a high scoring thriller. Ben Carrs all round feats of 46 and 2/18 was the catalyst, while Vaughan Garner chipped in with a valuable 42* after blocking a hat trick ball off an express bowler into his head, but it was Andy Taylors scarcely believable direct hit from deep mid wicket that quashed West Coburgs chase. A Mick Pataki (72*) inspired chase of 192 against Sunshine instilled a belief that any opposition could be swept aside, which was on stark display against Barkly St, where Vaughan removed the gloves and promptly picked up 4/21 in a dominant seven wicket win.\n\nThe seasons highlight, however, was undoubtedly Billy Morrisons outrageous 67 ball century against Sydenham Hillside. Five other innings mustered just nine runs, but if the ball is in the right area he can give it a wallop. Sydenham Hillside bowled exclusively in his area, and Billy obliged with nine sixes, including a massive hit onto a school building roof. Some late cameos from Dave Bell and Matthew Cross took the total to a mammoth 7/284. Unfortunately, that would be our last win for the year. Our next match against Clarkefield was marked by a tight bowling displayuntil the final four overs, where we conceded 54 runs. Some high class bowling in return meant we could only stagger to 9/88 off our quota. Despite this, nothing could remove us from third place, and we were gifted a place in the semi final against West Coburg after rain defeated Sydenham Hillside.\n\nThe match started well enough, with Cooper Reid gaining an early breakthrough with his off spin, having been introduced by Chris in just the fourth over. Carree proved close to unplayable, while old boys Mick and Cocko were at their frugal best. Chris even remembered how to bowl late in the innings, matching Coops three wickets, but a 19 run last wicket stand took the total to a more defendable 137. The early loss of Mick was offset by staunch defence from Vaughan and Carree against quality bowling, but one of the aggressive batsmen in the side needed to click, which Kale Cetinich was able to do in style, with 43 off 49. Vaughans dismissal for a laborious 62 ball 19 signalled the entrance of the aggressors, and with 65 to get off 12 overs with seven wickets in hand, the chase was on, especially with West Coburgs best bowlers almost bowled out. Kale fell 12 runs later, and with the oppositions lesser lights shining (the rarely bowling skipper had a spell of 4/0 off eight balls), so begun a terminal collapse of 7/21. The consolation prize was that we made more against them than the minor premiers did in the grand final. Crossy also added an unbeaten 2 at the end of the match, taking his season average to 70.\n\nOn an individual note, Mick and Vaughan battled it out all year for both the Club Champion and the Batting Average. In the end Mick comfortably took out the Club Champion and snuck the batting prize by just 0.67. They also finished second and third in the respective competition awards, while Chris all round feats gave him seventh in the competition Champion Player. Coop was never really threatened in the Bowling Average (largely thanks to Carrees frustrating ability to make batsmen play and miss), picking up 17 wickets to finish second in the competition.'),(5,'Been a long time coming but in four weeks we\'re once again taking the field! Our fifth Willowfest campaign will see a host of familiar names return, plus one debutant:\n\nMatt Barclay (c)\nChris Barclay\nMichael Dann\nAndrew Dowell\nColin Finn\nVaughan Garner\nClinton Murdoch\nTravis Murdoch\nJosh O\'Dwyer\nSimon O\'Shea\nJosh Pearce\nWarren Sidebottom\n\nIN: Pearce (new - St Mary\'s Tyntender), O\'Shea\nOUT: D.Taylor (paternity leave), P.Barclay (retired??), Lahn, Mason (both rested)\n\n<a href=\"http://mycricket.cricket.com.au/common/pages/public/rv/draw.aspx?entityid=11103&id=RVFIXTURE\">Fixture</a>'),(6,'Match review test'),(7,'Even the most hyped of previews couldn\'t have predicted such a classic finish as the one enjoyed - or in our case endured - here. The most flimsy of JWXI lineups past wouldn\'t lose 5/9 with 11 to win, yet a strong team obliged thanks to amazing catches and panic. By the end of the match, Michael Dann\'s maiden five-wicket haul had been all but forgotten as Brendan McCarthy stole the limelight with his own Michelle and the reality of the collapse set in.\n\nOn a patchy pitch that would seam regularly, keep low often and occasionally leap menacingly at batsmen\'s throats, and with the knowledge of Hutt River\'s opening innings struggles, Matt Barclay was more than happy to have a bowl first. Apart from the umpires, who neglected to organise a toss until a couple of minutes before start time (the two captains\' own toss was not recognised and a subsequent toss produced the same result), everything started regularly enough - early hijinks, Jarryd Mills falling to Clinton Murdoch and Hutt River struggling to post a competitive total. The opening combatants met each other with matching headbands; Murdoch was friendly enough to deliver an unplayable leg-cutter instead of a head hunter, but the celebrations were raucous when Mills chipped the fourth ball straight to Damien Taylor at mid-off, who put aside another great JWXI tradition of dropping batsmen in the first over by pouching the gift safely. Chris Barclay struggled to capitalise early, conceding seven before bowling a legal delivery, but in his second over he showed everyone exactly how a backhand slower ball should be bowled, flummoxing Haydn Falconer with the perfect delivery that was met with several airswings before it disturbed off stump. An LBW a piece for Matt Barclay and Josh O\'Dwyer put a stop to the first block of resistance from Bill Barber and Brendan McCarthy, leaving the match well poised at 4/53. A fired up O\'Dwyer smelled blood and got a bouncer to rear nastily into Jake Sluiter\'s helmet. His dismissal at the hand of Barclay for a 28 ball 5 put even more pressure on Joel McMahon, who was the only batsman that looked comfortable on the minefield, as McMahon\'s father Ian entered and took non-scoring to new levels. Like last year\'s battle, Dann enjoyed the blockathon, massaging his Onion Patch record even further. A rare short ball was the answer to the younger McMahon\'s prayers, but he had forgotten about Colin Finn prowling at backward square leg, who took a sharp catch.\n\nAdam Burke briefly threatened to smash Hutt River back into the game, but on 14 he narrowly failed to clear Andrew Dowell at long on. Dann followed up three balls later by inducing a poor shot from new skipper Tyler Hankinson, leaving the stoic Ian McMahon to eke out some runs with the tail. Having received manic cheers when he finally got off the mark, McMahon must have thought his job was done and decided to hit out. His first attempt was a soft shovel to Dowell at mid wicket that handed Dann a four-wicket haul for the first time. Next ball, Dann became just the third JWXI bowler, and second at Willowfest, to take five wickets in an innings when Todd McCarthy squirted a full ball to Chris Barclay at point.\n\nThree wides off the first ball was immediately followed by Warren Sidebottom\'s leaging edge to fly slip, where Hankinson took a good catch running back to give Jackson Brazzale his first wicket against JWXI. Colin Finn\'s promotion was slightly more successful, lasting nine balls before Barber pushed a full ball through his cross-batted defence. Dann then continued his one man show; with Vaughan Garner for support, he made the pitch look benign with a series of sublime shots, including a sweetly struck pull shot that almost cleared the long square leg boundary. Having cruised to 32, he  must have copped a bad drink as Sluiter was able to disturb his stumps first ball after the break. Dann\'s wicket created another mini collapse, with similar deliveries from Sluiter doing for Kale Cetinich and Ben Mason in consecutive balls.\n\nChris Barclay briefly resumed the fun by arriving at the crease wearing a beer hat, but quickly disposed it and knuckled down with Garner in a marathon chess game against Hutt River\'s probing pace bowlers. For almost 20 overs, the pair patiently contended with disciplined stump-to-stump bowling and smart fields - particularly from Sluiter, Barker and Brazzale at the Red Cliffs end - but were able eke out runs when they presented themselves, adding 39 to reduce the equation to 11 off as many overs. Garner had two tight moments; Joel McMahon\'s sharp riser narrowly avoided the band of the glove, clearing the slips cordon for a couple of leg byes. Soon after, Falconer overcame an erratic slow bowling start by sending down a relative thunderbolt to surprise Garner, who fended uncertainly and edged behind, according to all but the batsman himself and - most importantly - umpire Thewlis. Mills was particularly aggrived by the decision, leading to a lengthy slanging match between the former baggy red teammates.\n\nWith the match seemingly safe, Brendan McCarthy\'s introduction turned the match firmly on its head. Maintaining the pressure to the end, Garner waited for a loose ball to launch to the boundary. When he got it, a firmly struck cover drive had four written all over it, until McMahon dived full stretch at short cover and plucked it in his left hand, sending the batsman on his way for 36 off 106 - a new balls faced record for JWXI. Four balls later, O\'Dwyer aimed for his own boundary but made the mistake of hitting towards Todd McCarthy, who had had plenty of fielding practice throughout the match and was likely to hold a catch eventually. Matt Barclay was the next to try the big shot, but he could only find Hankinson, who held another good low catch. In three overs, the slow burner had exploded into life; seven runs needed in eight overs, two wickets in hand and Chris Barclay still standing on 10 off 64. Taylor showed great resolve, blocking out Sluiter\'s fourth maiden, but Barclay saw Brendan McCarthy\'s spin as the best chance to score runs. Twice he advanced down the wicket to scoop the ball to the vacant deep mid wicket, falling agonisingly short of a boundary on the second attempt. Going for glory, a third trip down the pitch proved unwise as McCarthy shortened his length and Mills cooly completed the stumping. Taylor again held out a Sluiter over, earning two valuable wides to almost tie the scores. Then, in circumstances eerily similar to the heartbraking Royal Park loss in 2008/09, it all came down to Murdoch to seal victory against the unstoppable McCarthy. Third ball, the improbable comeback was complete; a tickled cut was well held by Mills, sparking rampant celebrations and consigning JWXI to the narrowest of losses.'),(8,'Still seething from the opening day capitulation, a weak Willowfest XI were the perfect opposition to take our frustration out on. Fortunately for Warren Sidebottom, the fielders insisted on allowing us our redemption. In a 45 ball stay, the Messiah was put down no less than five times and escaped an easy stumping for good measure. Colin Finn was up to the challenge, doubling his Day 1 duration and equalling his top score of 5 in a 41 run opening stand. Andrew Dowell, who didn\'t bat in the first match, fell shortly after, but Matt Barclay was able to steady the ship while Sidebottom continued his charmed run. A five gave Sidebottom his third half-century, only for a non-catch dismissal to send him back next ball. Michael Dann again proved his worth in a manic 31, facing three dots out of 19 balls faced. His dismissal meant that Josh O\'Dwyer had just three balls to play with, all of which he expertly placed into gaps for a couple each.\n\nOur response with the ball could hardly have been much better, as Willowfest XI\'s top order found O\'Dwyer and Clinton Murdoch unplayable. Murdoch backed up O\'Dwyer\'s opening maiden with two wickets in three balls, cleaning up Kirwan Moore then watching Ben Gorham smash his first legal ball at Barclay\'s head, who thankfully got his hands in the way in time to grasp the scorcher. O\'Dwyer then notched his own scalp in the following over, leaving Willowfest XI\'s chase in tatters at 3/1. Courtney Moore and Wayne Stokes chose to blast the openers out of the attack rather than knuckle down. It did for O\'Dwyer, but Moore couldn\'t channel his aggression and made two now common mistakes; going after Dann\'s looseners, and going aerial in Finn\'s direction. Another day, another stunning catch at backward square leg for the Finnster, this time parrying a firmly struck ball and accepting the second bite. Moore\'s subsequent bat hurl perhaps indicated where the ball should have gone. \n\nDann and Murdoch couldn\'t keep out of the action, as the former held yeat another heatseeker to give the latter 3/15 at the end of his spell. Stokes continued to hit out to the point where not only had his team\'s blushes been spared, it was a genuine chance of winning the match. After copping much of the stick, Barclay eventually found Matt Noonan\'s edge, which Vaughan Garner was fortunate to cling on to one-handed after wrong-footing himself. Stokes continued past 50, taking the game to the final over with 26 runs needed. O\'Dwyer finished the contest by conceding 5 from the first three balls, although Ferguson still believed in suicidal running to the end. Playing and missing the second last ball, he took off for a non-existent bye that his partner had no interest in. Rather than saunter to the stumps, Garner chose the Lance approach, delivering an overarm throw with his glove still on to complete the runout. O\'Dwyer was then able to successfully defend 15 off the last ball to seal the first win of 2012.'),(9,'Still seething from the opening day capitulation, a weak Willowfest XI were the perfect opposition to take our frustration out on. Fortunately for Warren Sidebottom, the fielders insisted on allowing us our redemption. In a 45 ball stay, the Messiah was put down no less than five times and escaped an easy stumping for good measure. Colin Finn was up to the challenge, doubling his Day 1 duration and equalling his top score of 5 in a 41 run opening stand. Andrew Dowell, who didn\'t bat in the first match, fell shortly after, but Matt Barclay was able to steady the ship while Sidebottom continued his charmed run. A five gave Sidebottom his third half-century, only for a non-catch dismissal to send him back next ball. Michael Dann again proved his worth in a manic 31, facing three dots out of 19 balls faced. His dismissal meant that Josh O\'Dwyer had just three balls to play with, all of which he expertly placed into gaps for a couple each.\n\nOur response with the ball could hardly have been much better, as Willowfest XI\'s top order found O\'Dwyer and Clinton Murdoch unplayable. Murdoch backed up O\'Dwyer\'s opening maiden with two wickets in three balls, cleaning up Kirwan Moore then watching Ben Gorham smash his first legal ball at Barclay\'s head, who thankfully got his hands in the way in time to grasp the scorcher. O\'Dwyer then notched his own scalp in the following over, leaving Willowfest XI\'s chase in tatters at 3/1. Courtney Moore and Wayne Stokes chose to blast the openers out of the attack rather than knuckle down. It did for O\'Dwyer, but Moore couldn\'t channel his aggression and made two now common mistakes; going after Dann\'s looseners, and going aerial in Finn\'s direction. Another day, another stunning catch at backward square leg for the Finnster, this time parrying a firmly struck ball and accepting the second bite. Moore\'s subsequent bat hurl perhaps indicated where the ball should have gone. \n\nDann and Murdoch couldn\'t keep out of the action, as the former held yeat another heatseeker to give the latter 3/15 at the end of his spell. Stokes continued to hit out to the point where not only had his team\'s blushes been spared, it was a genuine chance of winning the match. After copping much of the stick, Barclay eventually found Matt Noonan\'s edge, which Vaughan Garner was fortunate to cling on to one-handed after wrong-footing himself. Stokes continued past 50, taking the game to the final over with 26 runs needed. O\'Dwyer finished the contest by conceding 5 from the first three balls, although Ferguson still believed in suicidal running to the end. Playing and missing the second last ball, he took off for a non-existent bye that his partner had no interest in. Rather than saunter to the stumps, Garner chose the Lance approach, delivering an overarm throw with his glove still on to complete the runout. O\'Dwyer was then able to successfully defend 15 off the last ball to seal the first win of 2012.'),(10,'Clinton Murdoch became the fourth player to reach the 47 match milestone and was subsequently rewarded with opening the batting alongside Kale Cetinich. For six overs, the new combination looked like the real deal, driving and cutting with aplomb. Murdoch was the first to go for a sound 18, making way for one of the more memorable JWXI innings. Committed to leaving his first ball, Damien Taylor watched it all the way into middle and off stump. He later informed his teammates that his thought as the ball pitched was \"Ooh, that\'s going to be tight\". The dismissal sparked raucous laughter and later spawned a new dance (see history section). Cetinich\'s wicket meant that 3/8 had fallen in seven balls, but Michael Dann and Vaughan Garner didn\'t let the innings stagnate, adding 59 in 8.2 overs. The journey included a new bat for Dann after one boundary cut his original piece of willow in half (the broken shard reached mid on), a new shot for Garner when he unveiled a switch pull to a vacant third man at the first sight of a half tracker, and probably a new fielding coach for Puka Puka after the man at mid-off shelled a chest-high sitter off Garner. All those highlights, however, had nothing on the reception Ben Mason received when he finally got off the mark in his JWXI career, courtesy of a leading edge sneaking over the keeper\'s head. The remaining batsmen made sure the innings didn\'t fade out too dramatically, setting a competitive 131 to win.\n\nJosh O\'Dwyer gave the team the perfect start with a wicket maiden, although it may have been a better move to keep Matt Kirirua in the sheds. The former player of the carnival wasted little time in flogging the bowlers to all parts, taking it upon himself to carry his team over the line. Matt Barclay copped the brunt of the onslaught as consecutive good length balls were helped on their way over the long on boundary. Barclay bounced back beautifully, however, picking up 1/5 in his remaining two and a half overs. Unperturbed, Kirirua chose to savage Taylor\'s mediums, taking 25 off his two overs. Cetinich got the ball to misbehave immediately following his introduction and should have had Kirirua stumped on 66 after the batsman advanced, missed a lifter and Garner removed the bails with the bat just in the air, but the pleading appeal failed to sway the umpire. That had nothing on the frustration felt in the following over when Malo Kirirua hit the cover off an O\'Dwyer delivery and the umpire failed to detect the edge. The turned down stumping cost eight runs as Cetinich finally removed Matt Kirirua for 74 off just 50 balls, with Murdoch taking a sound catch at deep mid wicket.\n\nThe final four overs were now about who would blink first as the two teams consistently matched each other. O\'Dwyer closed out another fantastic spell with a second wicket, leaving 23 runs required off three overs. Murdoch then uncharacteristically sent down two wides but still only went for seven. Both sides were feeling the pressure in Dann\'s final over; on the second ball, Raki Woetai skied one to Chris Barclay at mid off, who put down the catch, but composed himself enough to throw back to Dann and catch the batsman out of his crease after he had inexplicably tried to convince his partner of a second run. It all came down six off the last over (later discovered to be eight), to be bowled by Murdoch. Another wide followed by three singles off the first three balls almost finished it, but a clutch runout from Taylor at mid wicket kept it alive. Seemingly needing one to win off the last ball, Teei Piawi hacked in Taylor\'s direction, brushing the fieldsman\'s fingers on the way to the boundary. Another frustrating loss had all but ended the premiership chances, but at least the events on the final ball put the result beyond the doubt of the scorebook.'),(11,'Needing a win to have any chance of staying alive in the competition, we went up against the Muppetts, who could all but seal the premiership with their own victory. To aid their cause, they spent the match eve feeding Josh O\'Dwyer free drinks to put him off his game. O\'Dwyer wasn\'t feeling the best, but was by no means incapacitated. The same couldn\'t be said for the Muppetts, who had three players forced onto the bench (although much of their time was spent lying prone on the grass) and several others unable to muster a jog on field. With this in mind, our batsmen chose to conserve energy and walk for runs, belying our determination for victory.\n\nAllowed to open again, Clinton Murdoch was equally determined to take full advantage of a benign pitch, doggedly holding down an end as Colin Finn took up the unlikely role of senior partner. The new ball specialist looked composed during his 17 ball stay, but succumbed with a maiden double-figure score within touching distance. Warren Sidebottom\'s streak of good fortune was on show again as the Muppetts dropped catches seemingly at will off both batsmen. While Murdoch needed 36 balls to reach 10, Sidebottom didn\'t care for mucking around, hitting a series of boundaries before getting tied down after the first drinks break and giving his wicket away. Micheal Dann was unable to draw on Sidebottom\'s luck well, smashing a cover drive straight into Gary Bell\'s hands on 11. The only man who looked like taking a catch soon had another scorcher coming his way when Matt Barclay sweetly flicked a full ball to midwicket. Murdoch was unfazed, coasting to his second JWXI half-century, before O\'Dwyer was comprehensively bowled by the unassuming Steve \"Drop Bear\" Smith. \n\nA promising start had been momentarily halted, however Vaughan Garner was in no mood to hand back the advantage, joining Murdoch in a 59 run partnership. Regularly considered to take the game too seriously, Garner would receive a small ovation for having a crack following his dismissal, while Murdoch was increasingly subjected to heckling and gameplaying despite a considerable increase in his scoring rate. Unable to find one of his gloves following the second drinks break, Murdoch was forced to borrow his partner\'s, as soon-to-be carnival Fastest Bowler Daniel Bramich shelved his spin trial and fired in six bullets at the bemused batsman. Only at the end of the over was Murdoch\'s glove revealed to have been placed in the sprinkler hatch by lead heckler Steve Long. Understandably tired after 40 overs, Murdoch went down swinging, striking three boundaries in six balls and hanging on long enough to reach 70 - equal 10th on the all time list - and take the two day old balls faced record by seeing out 120 (or as the Willowfest site posted, 1120). Garner continued to swing afer surviving his second dropped sitter in two days. On the magical 47, he took a calculated risk of 50 or out and skied an ambitious hoick to mid on, leading teammates to believe he got out on purpose. In the final overs, Pete Barclay gave a glimpse of his glory years with a quickfire 17, while Ben Mason\'s maiden runs must have convinced him that he was a batsman, playing a textbook flick to the legside for another couple to take the score to 225.\n\nThe Finn opening experiment was then momentously carried over to the bowling crease. Tom Bowman\'s nerve buckled at the prospect of falling to the erratic offerings; attempting a launch over the infield, the batsman tamely chipped it in the air to O\'Dwyer, giving Finn his first wicket in almost six years. The four leading bowlers were expected to capitalise on the initial breakthrough, but with a steady Chris Worrell at one end, Chris Dunbar went on a dancing sojourn, regularly waltzing down the wicket to hit wherever he liked. A helpless Johnnie outfit watched as the partnership swelled to 120. It was up to the unheralded Damien Taylor to save the team\'s face (as well as his own after the previous day\'s antics). The eldest Taylor settled on a length, brought the keeper up to the stumps and quickly found himself in control of proceedings. Worrell was the first to blink, gaining entry into Finn\'s backward square leg bunnies club. Peter Cook helped add another 32, but despite Dunbar approaching a blistering century, the lack of freedom placed on the batsmen had slowed the run rate considerably. Continuing his inspired spell, Taylor went straight through Cook for 8, then followed up with the big fish when Dunbar poked an edge which was well taken by Garner. Dann completed the momentum shift next over, luring Paul Unkles down the wicket for a comfortable stumping. Taylor closed out a match-changing four wicket haul by cleaning up Bramich, but Bell took up the slack to keep the Muppetts alive. \n\nWith the match reaching a tight conclusion, Murdoch lifted himself to get rid of his new enemy, before wickets to Matt Barclay and O\'Dwyer left the Muppetts needing seven from the final over with one wicket in hand. A scampered bye from a Garner error allowed Bell to immediately take strike. Two more came off the second ball and it looked like we would suffer the narrowest of losses for a third consecutive day. Thankfully, the final pair channelled 1999 South Africa; wanting to maintain the strike, Bell forgot to tell Smith not to run before hitting to deep mid off. Under intense pressure, Chris Barclay cooly returned the ball to his brother to complete the run out and finally edge a close one in the Johnnies\' favour. Unfortunately, our premiership chances were still out of our hands, and Hutt River\'s big win over Willowfest XI consigned the final match against The Toads to dead rubber status.');
